        #region Private Methods

        private void btnDeletePerson_Click(object sender, System.EventArgs e)
        {
            if (!KissMsg.ShowQuestion("CtlPersonLöschen", "PersonWirklichLöschen", "Wollen Sie die Person '{0}, {1}' und die davon abhängigen Daten wirklich definitiv und unwiderruflich aus der KiSS-DB löschen?", 0, 0, true, qryPerson["Name"], qryPerson["Vorname"]))
                return;

            try
            {
                DBUtil.ExecSQLThrowingException("exec [spDeletePerson] {0}", qryPerson["BaPersonID"]);
            }
            catch (Exception ex)
            {
                KissMsg.ShowError("CtlPersonLöschen", "Person nicht löschbar", "Die Person konnte nicht gelöscht werden. Wahrscheinlich bestehen noch Abhängigkeiten, die nicht automatisch gelöscht werden", ex);
            }
        }

        private void qryPerson_PositionChanged(object sender, System.EventArgs e)
        {
            if (!DBUtil.IsEmpty(qryPerson["BaPersonID"]))
            {
                qryDependentRows.Fill("exec [spGetDependendRowCount] 'BaPerson', {0}", qryPerson["BaPersonID"]);
                btnDeletePerson.Enabled = true;
            }
            else
                btnDeletePerson.Enabled = false;
        }

        #endregion
